from typing import List
"""
'0's (water), return the number of islands.

An island is surrounded by water and is formed by connecting adjacent lands horizontally or vertically.
 You may assume all four edges of the grid are all surrounded by water.

 #assume can only search left, right, top, down -- NO MORE
"""

class Solution:
    def numIslands(self, grid: List[List[str]]) -> int:

        # Find dimentions of graph m (rows) x n (columns)
        rows = len(grid)
        columns = len(grid[0])

        # make sure there is an optimal graph
        if rows < 1 or columns < 1:
            return 0
        
        island_count = 0


        
        for x in range(0, rows): # iterate through all the rows
            for y in range(0, columns): # iterate through all the values in a row
                if grid[x][y] == "1": # if a valie is 1....
                    island_count += 1 # increased count by 1
                    grid = self.DFS(x,y, grid, rows, columns) # Use

        return island_count
    
    # find how many squares in grid are conencted and have a value of '1'
    def DFS(self, x, y, grid: List[List[str]], rows, columns):
        grid[x][y] = "0" # to avoid infinite loop, set provided value to '0' so not visited more than once


        if x+1 < rows: # Bottom
            if grid[x+1][y] == "1":
                self.DFS(x+1, y, grid, rows, columns)
        if x-1 >= 0: # Top
            if grid[x-1][y] == "1":
                self.DFS(x-1, y, grid, rows, columns)
        if y-1 >= 0: # Left
            if grid[x][y-1] == "1":
                self.DFS(x, y-1, grid, rows, columns)
        if y+1 < columns: # Right
            if grid[x][y+1] == "1":
                self.DFS(x, y+1, grid, rows, columns)

        return grid


